INSERT INTO `discoveroffcampus` (`Name`, `Type`, `Description`, `Address`, `openingHours`, `pictures`) VALUES
('Ants ', ' Shop ', '  a place where you can find all kinds of leather handmade accessories, clothings, incense, bags, books, vinyl records, paintings, silver handmades. Ants is a synthesis of diverse cultural productions, merging between art / music / film / handmades / drinks from Armenian, Indian, Balkan, middle and far eastern cultures. ', ' beirut, hamra, makhoul street ', ' Mon - Sat 11:00 am - 9:30 pm', 'ants.jpg'),
('Babel Theater ', ' Theater ', ' A Place for interesting shows, screenings and exhibitions ', ' Cairo Street, Hamra, Beirut ', ' Event Basis ', 'babel.jpg'),
('Busy Box ', ' Art Space ', ' A Creative space for adults and children to paint, draw, make pottery and other arts and crafts ', ' Taj Tower Crowne Plaza Lower Ground Floor Hamra-Beirut, Lebanon ', ' Monday-Thursday 10:30 a.m. to 7:30 p.m.', 'busybox.jpg'),
('Joon On The Moon ', ' Arts & Crafts Cafe ', 'Joon On The Moon is a cafe, boutique and a workshops space located in Beirut, Lebanon. It''s a place where you can create, shop and chill.', ' 100 Rue du Liban, Beirut  ', '  Tue - Sat 12:00 pm -12:00 am', 'joononthemoon.jpg'),
('Metro Al Madina', ' Theater', ' a micro-theater patched into a hybrid pop-cultural cabaret hall with a versatile stage, a multi-platform seating area rearranged to accommodate tables and couches, a spacious backstage area and nice busy people buzzing around and a friendly little bar.  ', '  Saroulla Building, Hamra, Beirut ', ' Event Basis', 'metro.jpg'),
('Souk El Tayeb ', ' Farmers Market ', ' Open Air Farmers Market ', ' Gefinor Center ', ' Every Wednesday 12pm - 6pm', 'souk.jpg'),
('The Art Workshop ', ' Arts Center ', ' A place to take walk-in  lessons in arts and crafts', ' 10:00am - 6:00pm', ' Adonist street, Ayad building, Hamra, Beirut', 'theartworkshop.jpg');
