CREATE DATABASE `sweep`;
USE `sweep`;

CREATE TABLE `allclasses` (
  `Name` varchar(20) DEFAULT NULL,
  `BuildingId` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE `buildings` (
  `Name` varchar(50) NOT NULL,
  `ID` int(11) NOT NULL,
  `Abbreviation` varchar(20) DEFAULT NULL,
  `Description` varchar(10000) DEFAULT NULL,
  `Alias` varchar(20) DEFAULT NULL,
  `PicturesId` int(11) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `buildingscoordinates` (
  `Name` varchar(200) NOT NULL,
  `X` float NOT NULL,
  `Y` float NOT NULL,
  `Z` float NOT NULL,
  `W` float NOT NULL,
  `K` float NOT NULL,
  `J` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `courses` (
  `Abbreviation` varchar(20) DEFAULT NULL,
  `Name` varchar(20) DEFAULT NULL,
  `Time` varchar(20) DEFAULT NULL,
  `InstructorName` varchar(200) DEFAULT NULL,
  `BuildingName` varchar(200) DEFAULT NULL,
  `BuildingId` int(11) DEFAULT NULL,
  `labTime` varchar(200) DEFAULT NULL,
  `buildingLabName` varchar(200) DEFAULT NULL,
  `buildingLabId` varchar(1000) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `department` (
  `ID` int(11) NOT NULL,
  `Name` varchar(30) NOT NULL,
  `BuildingId` int(11) NOT NULL,
  `FacultyId` int(11) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `discoveroffcampus` (
  `Name` varchar(90) NOT NULL,
  `Type` varchar(200) NOT NULL,
  `Description` varchar(400) DEFAULT NULL,
  `Address` varchar(300) NOT NULL,
  `openingHours` varchar(200) NOT NULL,
  `pictures` varchar(300) DEFAULT NULL,
  PRIMARY KEY (`Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `eatoffcampus` (
  `Name` varchar(20) NOT NULL,
  `Study` varchar(20) DEFAULT NULL,
  `Rating` varchar(20) DEFAULT NULL,
  `Address` varchar(200) DEFAULT NULL,
  `Cuisine` varchar(50) DEFAULT NULL,
  `CostPerPerson` varchar(20) DEFAULT NULL,
  `OperatingHours` varchar(100) DEFAULT NULL,
  `Pictures` varchar(300) DEFAULT NULL,
  `Smoking` int(11) DEFAULT NULL,
  `Wifi` int(11) DEFAULT NULL,
  PRIMARY KEY (`Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `eatoncampus` (
  `Name` varchar(20) NOT NULL,
  `Area` varchar(20) NOT NULL,
  `PriceRange` varchar(20) DEFAULT NULL,
  `Buildings_ID` int(11) NOT NULL,
  `Pictures_ID` int(11) DEFAULT NULL,
  PRIMARY KEY (`Name`,`Area`,`Buildings_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `faculty` (
  `ID` int(11) NOT NULL,
  `Name` varchar(200) NOT NULL,
  `ShortName` varchar(20) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `gatestunnels` (
  `Name` varchar(20) NOT NULL,
  `Buildings_ID` int(11) DEFAULT NULL,
  PRIMARY KEY (`Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `instructor` (
  `Name` varchar(20) NOT NULL,
  `Email` varchar(20) DEFAULT NULL,
  `DepartmentId` int(11) DEFAULT NULL,
  `Floor` varchar(20) DEFAULT NULL,
  `Room` varchar(20) DEFAULT NULL,
  `BuildingId` varchar(200) DEFAULT NULL,
  `PicturesId` int(11) DEFAULT NULL,
  PRIMARY KEY (`Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




CREATE TABLE IF NOT EXISTS `machine` (
  `Type` varchar(20) NOT NULL,
  `Bank` varchar(20) DEFAULT NULL,
  `BuildingId` int(11) NOT NULL,
  PRIMARY KEY (`Type`,`BuildingId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `paperwork` (
  `Name` varchar(20) NOT NULL,
  `Requirement` varchar(1000) DEFAULT NULL,
  `BuildingId` int(11) NOT NULL,
  `Description` varchar(5000) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `pictures` (
  `ID` int(11) NOT NULL,
  `Name` varchar(20) NOT NULL,
  `picture` varchar(200) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `pins` (
  `Name` varchar(200) NOT NULL,
  `X` float NOT NULL,
  `Y` float NOT NULL,
  `Z` float NOT NULL,
  `W` float NOT NULL,
  `K` float NOT NULL,
  `J` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `specialplaces` (
  `Name` varchar(100) NOT NULL,
  `Abbreviation` varchar(20) DEFAULT NULL,
  `BuildingId` int(11) DEFAULT NULL,
  `Description` varchar(1000) DEFAULT NULL,
  PRIMARY KEY (`Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `staff` (
  `Name` varchar(20) NOT NULL,
  `Email` varchar(20) DEFAULT NULL,
  `Department` varchar(20) DEFAULT NULL,
  `Room` varchar(20) DEFAULT NULL,
  `BuildingId` int(11) DEFAULT NULL,
  PRIMARY KEY (`Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `studyoncampus` (
  `Name` varchar(20) NOT NULL,
  `Area` varchar(20) NOT NULL,
  `Restrictions` varchar(20) DEFAULT NULL,
  `BuildingsId` int(11) NOT NULL,
  PRIMARY KEY (`Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


